import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Container,
  Box,
  Paper,
  CircularProgress
} from '@mui/material';
import axios from '../utils/axiosConfig';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';

const Home = () => {
  const [hasDataset, setHasDataset] = useState(false);
  const [datasetName, setDatasetName] = useState('');
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  const handleLogout = () => {
    toast.info('You have been logged out!');
    navigate('/login');
  };

  const fetchDatasetStatus = async () => {
    try {
      const response = await axios.get('/check-dataset', {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setHasDataset(response.data.hasDataset);
      setDatasetName(response.data.datasetName || '');
    } catch (error) {
      console.error('Error fetching dataset status:', error);
      toast.error('Failed to fetch dataset status.');
    } finally {
      setIsLoading(false);
    }
  };

  const handleReplaceDataset = async () => {
    if (!file) {
        toast.warning('Please select a dataset to replace.');
        return;
    }

    if (!fileType) {
        toast.warning('Please select the file type.');
        return;
    }

    const formData = new FormData();
    formData.append('file', file);
    formData.append('file_type', fileType);

    try {
        const response = await axios.post('/replace', formData, {
            headers: { 'Content-Type': 'multipart/form-data' },
        });
        toast.success(response.data.message || 'Dataset replaced successfully!');
        navigate('/chat'); // Redirect to chat after replacement
    } catch (error) {
        toast.error(error.response?.data?.message || 'Failed to replace dataset');
    }
};

  const handleContinueToChat = () => {
    navigate('/chat');
  };

  useEffect(() => {
    fetchDatasetStatus();
  }, []);

  if (isLoading) {
    return (
      <Box
        sx={{
          height: '100vh',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          backgroundColor: '#ffebc5',
        }}
      >
        <CircularProgress />
      </Box>
    );
  }

  return (
    <>
      <AppBar position="sticky" sx={{ mb: 4, bgcolor: '#d32f2f', boxShadow: 2 }}>
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1, color: '#fff' }}>
            MyApp
          </Typography>
          <Button color="inherit" onClick={handleLogout} sx={{ textTransform: 'none' }}>
            Logout
          </Button>
        </Toolbar>
      </AppBar>

      <Container
        sx={{
          height: 'calc(100vh - 64px)', // Subtract navbar height
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          backgroundColor: '#ffebc5', // Light yellow background
        }}
      >
        <Paper
          elevation={6}
          sx={{
            padding: 4,
            borderRadius: 2,
            width: '100%',
            maxWidth: 500,
            textAlign: 'center',
            backgroundColor: '#fff3e0', // Light orange for the paper
            boxShadow: 3,
          }}
        >
          {hasDataset ? (
            <>
              <Typography variant="h5" gutterBottom sx={{ color: '#d32f2f', fontWeight: '600' }}>
                Dataset Found: {datasetName}
              </Typography>
              <Typography variant="body1" sx={{ mb: 4 }}>
                You can continue to the chat with the uploaded dataset or replace it with a new one.
              </Typography>
              <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
                <Button
                  variant="contained"
                  color="primary"
                  onClick={handleContinueToChat}
                  sx={{
                    textTransform: 'none',
                    fontWeight: 'bold',
                    borderRadius: 2,
                  }}
                >
                  Continue to Chat
                </Button>
                <Button
                variant="contained"
                color="error"
                fullWidth
                size="large"
                onClick={handleReplaceDataset}
                sx={{
                    textTransform: 'none',
                    fontWeight: 'bold',
                    borderRadius: 2,
                    boxShadow: 3,
                    '&:hover': {
                        backgroundColor: '#b71c1c',
                        boxShadow: 5,
                    },
                }}
            >
                Replace Dataset
            </Button>
              </Box>
            </>
          ) : (
            <>
              <Typography variant="h5" gutterBottom sx={{ color: '#d32f2f', fontWeight: '600' }}>
                No Dataset Found
              </Typography>
              <Typography variant="body1" sx={{ mb: 4 }}>
                Please upload a dataset to start using the service.
              </Typography>
              <Button
                variant="contained"
                color="error"
                onClick={() => navigate('/upload')}
                fullWidth
                sx={{
                  textTransform: 'none',
                  fontWeight: 'bold',
                  borderRadius: 2,
                  boxShadow: 3,
                }}
              >
                Upload Dataset
              </Button>
            </>
          )}
        </Paper>
      </Container>
    </>
  );
};

export default Home;
